import styles from "./User.module.css";
interface UserProps {
  user: { email: string; number: string };
  loading: boolean;
}
function User({ user, loading }: UserProps) {
  return (
    <>
      <div className={styles.userWrapper}>
        <h1>{user?.email}</h1>
        <h2>{user?.number}</h2>
      </div>
    </>
  );
}

export default User;
